import React from 'react';
import { Link } from 'react-router-dom';

const App = () => (
  <div>
    <h1>Welcome to the Store Rating Platform</h1>
    <nav>
      <Link to="/login">Login</Link> | <Link to="/signup">Signup</Link>
    </nav>
  </div>
);

export default App;
